import React from "react";

const SearchBarItems = (props) => {
  return (
    <div>
      <NavLink
        className="item-container"
        to={props.url}
        // onClick={changeShipmentInfo}
      >
        {props.name}
      </NavLink>
    </div>
  );
};

export default SearchBarItems;
